// import { useState, useEffect  } from 'react'
// import scoreService from './services/scores'
// import DifficultyBar from './components/DifficultyBar.js'
import Beginner, { beginnerLoader } from './pages/Beginner.js'
import Intermediate, { intermediateLoader } from './pages/Intermediate.js'

import {
  createBrowserRouter,
  createRoutesFromElements,
  Route,
  RouterProvider
} from 'react-router-dom'
import './styles.css'
import 'bootstrap/dist/css/bootstrap.min.css'
import GameLayout from './layouts/GameLayout.js'

const router = createBrowserRouter(
  createRoutesFromElements(
    <Route path="/" element={ <GameLayout /> }>
      <Route
        path='beginner'
        element={ <Beginner /> }
        loader={ beginnerLoader }
      ></Route>

      <Route
        path='intermediate'
        element={ <Intermediate /> }
        loader={ intermediateLoader }
      ></Route>
    </Route>
  )
)

function App() {


  return (
    <>
      <RouterProvider router={router} />
    </>
  );
}

export default App;
